import React from 'react';
import './App.css';
import logo from './logo.png';

function App() {
  return (
    <div className="container">
      <img src={logo} alt="Stock Vision Logo" className="logo" />
      <h1>Stock Vision</h1>
      <p>AI-Powered Stock Forecasting</p>
    </div>
  );
}

export default App;
